  \"2015-05-06T23:05:29.797444\",\n\t\"name\": \"gbm-accreting-pulsar-histories\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"For each source we plot the history of pulse
  frequency and pulsed flux measured using the Fermi Gamma-Ray Burst Monitor (GBM)
  NaI detectors. For these measurements we use the CTIME data which normally has 0.256
  s time bins, and eight energy channels. Our analysis normally uses channels 1 (12-25
  keV) and 2 (25-50 keV). The integration interval used varies from source to source,
  ranging from one to four days. For eclipsing systems each egress to ingress interval
  is divided into an integral number of equal parts, with no measurement made during
  the eclipse. The measured frequencies are barycentered. For sources where the binary
  orbit is known, the frequencies are corrected for the binary motion. The R.M.S.
  pulsed flux is given in the energy band in which the pulse search was made. \",\n\t\"license_title\":
